import { UploadOutlined } from '@ant-design/icons';
import { Button, Form, Input, Select, Upload, Space } from 'antd';
import { useState } from 'react';

const { Option } = Select;
const formItemLayout = {
  labelCol: {
    xs: { span: 24 },
    sm: { span: 8 },
  },
  wrapperCol: {
    xs: { span: 24 },
    sm: { span: 16 },
  },
};
const tailFormItemLayout = {
  wrapperCol: {
    xs: { span: 24, offset: 0 },
    sm: { span: 16, offset: 8 },
  },
};

const Registration = () => {
  const [form] = Form.useForm();
  const onFinish = (values) => {
    console.log('Received values of form: ', values);
  };
  const prefixSelector = (
    <Form.Item name="prefix" noStyle>
      <Select style={{ width: 70 }}>
        <Option value="86">+91</Option>
        <Option value="87">+81</Option>
      </Select>
    </Form.Item>
  );
  const [autoCompleteResult, setAutoCompleteResult] = useState([]);
  const onWebsiteChange = (value) => {
    if (!value) {
      setAutoCompleteResult([]);
    } else {
      setAutoCompleteResult(['.com', '.org', '.net'].map((domain) => `${value}${domain}`));
    }
  };
  const normFile = (e) => {
    console.log('Upload event:', e);
    if (Array.isArray(e)) {
      return e;
    }
    return e?.fileList;
  };



  return (
    <div className="" style={{ backgroundColor: '#f5f5f5' }}>
      <div className="d-flex justify-content-center"></div>
      <h1>{autoCompleteResult}</h1>
      <Form method="POST"className='registration-form' id="registration-form"
        {...formItemLayout}
        form={form}
        onFinish={onFinish}
        style={{ maxWidth: 600 }}
        scrollToFirstError
      >
        <Form.Item
          name="UserName"
          label="UserName"
          onCahnge={{onWebsiteChange}}
          rules={[
            {
              required: true,
              message: 'Please input your UserName',
            },
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          name="PhoneNo"
